(ಎ) ಈ ಅಧಿನಿಯಮದ ಮೇರೆಗೆ ಕೊಡಬೇಕಾದ ಅಥವಾ ಕೊಡಲು ಅಧಿಕೃತಗೊಂಡ
ಯಾವುದೇ ನೋಟೀಸಿನ ನಮೂನೆ ಮತ್ತು ಅದನ್ನು ಜಾರಿಗೊಳಿಸಬಹುದಾದಂಥ ರೀತಿ;
(ಬಿ) ಈ ಅಧಿನಿಯಮದ ಮೇರೆಗೆ ವಿವರಣೆಗಳನ್ನು ನೀಡುವುದು;
(ಸಿ) ಏಜೆಂಟ್ ಅಧಿಕಾರಿಗಳಿಗೆ ಕೆಲಸದ ವಿವರಣೆ ಮತ್ತು ಹಂಚಿಕೆ ಮತ್ತು ಒಬ್ಬ ಏಜೆಂಟ್
ಅಧಿಕಾರಿಯ ಬಳಿ ಇಷ್ಟಾರ್ಥದಲ್ಲಿರುವ ಯಾವುದೇ ವ್ಯವಹಾರವನ್ನು ಮತ್ತೊಬ್ಬ ಏಜೆಂಟ್ ಅಧಿಕಾರಿಗೆ
ವರ್ಗಾವಣೆ ಮಾಡುವುದು;
(ಡಿ) ಸಾರ್ವಜನಿಕ ವಿವರಣೆಗಳನ್ನು ಸಾಧ್ಯವಿದ್ದಲ್ಲಿ ತೆಗೆದುಕೊಳ್ಳುವಲ್ಲಿ ಅನುಸರಿಸಬೇಕಾದ ವಿಧಾನ;
(ಇ) ಅನಧಿಕೃತ ಅಧಿಭೋಗಕ್ಕೆ ಸಂಬಂಧಿಸಿದ ಹಾನಿ ಪರಿಹಾರವನ್ನು ನಿರ್ಧರಿಸಬಹುದಾದ
ರೀತಿ ಮತ್ತು ಅಂತಹ ಹಾನಿ ಪರಿಹಾರವನ್ನು ನಿರ್ಧರಿಸುವಾಗ ಗಣನೆಗೆ ತೆಗೆದುಕೊಳ್ಳಬೇಕಾದಂಥ
ತತ್ವಗಳು;
(ಎಎ) 7ನೇ ಪ್ರಕರಣದ (1)ನೇ ಉಪಪ್ರಕರಣದ ಮೇರೆಗೆ ಮಾಡಲಾದ ಯಾವುದೇ
ಆದೇಶದಲ್ಲಿ ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ಬಾಡಿಗೆ ಅಥವಾ ಆ ಪ್ರಕರಣದ (2)ನೇ ಉಪಪ್ರಕರಣದ ಮೇರೆಗೆ
ನಿರ್ಧರಿಸಲಾದ ಹಾನಿ ಪರಿಹಾರ-ಬಾಕಿಗಳ ಬಾಕಿಗಳ ಮೇಲೆ ಸಂದಾಯವಾಗತಕ್ಕ ದರ;
(ಬಿಬಿ) 5ಸಿ ಪ್ರಕರಣದ (1)ನೇ ಉಪಪ್ರಕರಣದ ಮೇರೆಗೆ ಯಾವುದೇ ನಿರ್ಮಿತಿಯನ್ನು ಅಥವಾ
ಕಾಮಗಾರಿಯನ್ನು ಅಥವಾ ಯಾವುದೇ ಸಾರ್ವಜನಿಕ ವಿವರಣೆಗಳನ್ನು ಸೀಲ್ ಮಾಡಬಹುದಾದ ರೀತಿ;
(ಎಫ್) ಆಯೋಗಗಳನ್ನು ಸಲ್ಲಿಸಬಹುದಾದಂಥ ರೀತಿ ಮತ್ತು ಆಯೋಗಗಳಲ್ಲಿ ಅನುಸರಿಸಬೇಕಾದ
ಕಾರ್ಯವಿಧಾನ;
(ಜಿ) ನಿಯಮಿಸಬೇಕಾದ ಅಥವಾ ನಿಯಮಿಸಬಹುದಾದ ಯಾವುದೇ ಇತರ ವಿಷಯ.
